import React from "react";

function Calculator() {
  return (
    <div>
      <div class="ui inverted segment">
        <div class="ui inverted secondary menu">
          <a href="./" class="active item">
            Home
          </a>
          <a href="./" class="item">
            Messages
          </a>
          <a href="./" class="item">
            Friends
          </a>
        </div>
      </div>
    </div>
  );
}

export default Calculator;
